import "./QuoteCard.css";

const QuoteCard = ({ character, image, sampleQuote }) => (
  <figure className="QuoteCard">
    <img src={sampleQuote.image} alt={sampleQuote.character} />
    <figcaption>
      <blockquote>{sampleQuote.quote}</blockquote>
      <cite>{character}</cite>
    </figcaption>
  </figure>
);

export default QuoteCard;
